import { Container, Row, Col } from "react-bootstrap";
import TopInput from './TopInput'
export default function Footer() {
  return (
    <Container fluid>
      <Row>
        <Col className="bg-warning" sm={3}><TopInput/></Col>
        <Col className="bg-info" sm={9}>sm=4</Col>
      </Row>

    </Container>
  );
}
